#x27;).its(&#x27;stdout&#x27;).should(&#x27;contain&#x27;, &#x27;Jane Lane&#x27;);\nif (Cypress.platform === &#x27;win32&#x27;) {\n  cy.exec(`print ${Cypress.config(&#x27;configFile&#x27;)}`).its(&#x27;stderr&#x27;).should(&#x27;be.empty&#x27;);\n} else {\n  cy.exec(`cat ${Cypress.config(&#x27;configFile&#x27;)}`).its(&#x27;stderr&#x27;).should(&#x27;be.empty&#x27;);\n  cy.exec(&#x27;pwd&#x27;).its(&#x27;code&#x27;).should(&#x27;eq&#x27;, 0);\n}&quot;,&quot;err&quot;:{},&quot;uuid&quot;:&quot;00150c9a-8cef-4a7a-b55e-90585d11eacc&quot;,&quot;parentUUID&quot;:&quot;5662d96d-0a3d-4523-a34b-0e17c4a8423c&quot;,&quot;isHook&quot;:false,&quot;skipped&quot;:false},{&quot;title&quot;:&quot;cy.focused() - get the DOM element that has focus&quot;,&quot;fullTitle&quot;:&quot;Misc cy.focused() - get the DOM element that has focus&quot;,&quot;timedOut&quot;:null,&quot;duration&quot;:707,&quot;state&quot;:&quot;passed&quot;,&quot;speed&quot;:&quot;fast&quot;,&quot;pass&quot;:true,&quot;fail&quot;:false,&quot;pending&quot;:false,&quot;context&quot;:&quot;[\n    {\n        \&quot;title\&quot;: \&quot;Spec video recording\&quot;,\n        \&quot;value\&quot;: \&quot;videos/\\\\2-advanced-examples/misc.cy.js.mp4\&quot;\n    }\n]&quot;,&quot;code&quot;:&quot;// https://on.cypress.io/focused\ncy.get(&#x27;.misc-form&#x27;).find(&#x27;#name&#x27;).click();\ncy.focused().should(&#x27;have.id&#x27;, &#x27;name&#x27;);\ncy.get(&#x27;.misc-form&#x27;).find(&#x27;#description&#x27;).click();\ncy.focused().should(&#x27;have.id&#x27;, &#x27;description&#x27;);&quot;,&quot;err&quot;:{},&quot;uuid&quot;:&quot;739adbb9-c6a9-48e6-88e9-5fdb5867edd2&quot;,&quot;parentUUID&quot;:&quot;5662d96d-0a3d-4523-a34b-0e17c4a8423c&quot;,&quot;isHook&quot;:false,&quot;skipped&quot;:false},{&quot;title&quot;:&quot;cy.wrap() - wrap an object&quot;,&quot;fullTitle&quot;:&quot;Misc cy.wrap() - wrap an object&quot;,&quot;timedOut&quot;:null,&quot;duration&quot;:418,&quot;state&quot;:&quot;passed&quot;,&quot;speed&quo ot;:&quot;4ac79bc4-8c3f-4136-8d84-827d627ab05c&quot;,&quot;parentUUID&quot;:&quot;fbdc7c4b-9964-458f-a212-f3e38b0ddd7b&quot;,&quot;isHook&quot;:false,&quot;skipped&quot;:false},{&quot;title&quot;:&quot;cy.request() - pass result to the second request&quot;,&quot;fullTitle&quot;:&quot;Network Requests cy.request() - pass result to the second request&quot;,&quot;timedOut&quot;:null,&quot;duration&quot;:1076,&quot;state&quot;:&quot;passed&quot;,&quot;speed&quot;:&quot;fast&quot;,&quot;pass&quot;:true,&quot;fail&quot;:false,&quot;pending&quot;:false,&quot;context&quot;:&quot;[\n    {\n        \&quot;title\&quot;: \&quot;Spec video recording\&quot;,\n        \&quot;value\&quot;: \&quot;videos/\\\\2-advanced-examples/network_requests.cy.js.mp4\&quot;\n    }\n]&quot;,&quot;code&quot;:&quot;// first, let&#x27;s find out the userId of the first user we have\ncy.request(&#x27;https://jsonplaceholder.cypress.io/users?_limit=1&#x27;).its(&#x27;body&#x27;) // yields the response object\n.its(&#x27;0&#x27;) // yields the first element of the returned list\n// the above two commands its(&#x27;body&#x27;).its(&#x27;0&#x27;)\n// can be written as its(&#x27;body.0&#x27;)\n// if you do not care about TypeScript checks\n.then(user =&gt; {\n  expect(user).property(&#x27;id&#x27;).to.be.a(&#x27;number&#x27;);\n  // make a new post on behalf of the user\n  cy.request(&#x27;POST&#x27;, &#x27;https://jsonplaceholder.cypress.io/posts&#x27;, {\n    userId: user.id,\n    title: &#x27;Cypress Test Runner&#x27;,\n    body: &#x27;Fast, easy and reliable testing for anything that runs in a browser.&#x27;\n  });\n})\n// note that the value here is the returned value of the 2nd request\n// which is the new post object\n.then(response =&gt; {\n  expect(response).property(&#x27;status&#x27;).to.equal(201); // new entity created\n  expect(response).property(&#x27;body&#x27;).to.contain({\n    title: &#x27;Cypress Test Runner&#x27;\n  });\n  // we don&#x27;t know the exact post id - only that it will be
